import './App.css';
import TeamBuilder from "./Component/TeamBuilder";
import PokemonList from "./Component/PokemonList";
import {useEffect, useState} from "react";
import axios from "axios";

function App() {

    const [team, setTeam] = useState([6]);
    const [pokemon, setPokemon] = useState({});

    useEffect(() => {
        fetchPokemon();
    }, []);

    useEffect(() => {
        console.log(pokemon);
    }, [pokemon])

    const fetchPokemon = async () => {
        const response = await axios.get("http://localhost:8080/pokemon/6");
        setPokemon(response.data);
    };

    return (
        <div className="App">
            <header>
                <div className={"title"}>
                    PokeBuilder
                </div>
            </header>
            <TeamBuilder/>
            <PokemonList/>
        </div>
    );
}

export default App;
